import React from 'react';
import Header from '../Header/Header';
import Footer from '../Footer/Footer';
import './Dashboard.css';
import '../../css/cirrus-core.min.css';
import '../../css/cirrus.min.css';
import '../../css/layout.css';
import '../../css/phishducation.css';

const Dashboard = () => {
    return (
      <div>
        <Header />
        <div id="content" class="content">
        <div class="containerOFF" style={{backgroundColor: "#FAFBFD"}}>
          <div class="row">
            <div class="dashboard-side-panel col-md-4 col-lg-4" data-aos="fade-right" data-aos-duration="1000" data-aos-once="true">
              <h2 style={{color: "#385B64"}}>Aastha</h2>
              <h4> Level: 1</h4>
              <hr />
              <h6>Start a session:</h6>
              <button type="button" class="dashBtnB" onclick="window.location.href = '/game/phish-game'" style={{marginBottom: "1rem", width: "180px"}} data-aos="fade-right" data-aos-duration="1000" data-aos-once="true" data-aos-delay="320"><i class="fas fa-gamepad" style={{paddingRight: "5px"}}></i>Play Phooled</button>
              <button type="button" class="dashBtnB" onclick="window.location.href = '/game/betaphish'" style={{marginBottom: "1rem", width: "180px"}} data-aos="fade-right" data-aos-duration="1000" data-aos-once="true" data-aos-delay="320"><i class="fas fa-gamepad" style={{paddingRight: "5px"}}></i>Play BetaPhish</button>
              <button type="button" class="dashBtnB"style={{marginBottom: "1rem", width: "180px"}} onclick="window.location.href = '{% url 'active_quiz_sesson' %}'" data-aos="fade-right" data-aos-duration="1000" data-aos-once="true" data-aos-delay="320"><i class="fas fa-pencil-alt" style={{paddingRight: "5px"}}></i>Start a Quiz</button>

              <h6>Learn:</h6>
              <button type="button" class="dashBtnB" onclick="window.location.href = '{% url 'user_course' %}'" data-aos="fade-right" data-aos-duration="1000" data-aos-once="true" data-aos-delay="320" style={{marginBottom: "1rem", width: "150px"}}><i class="fas fa-video" style={{paddingRight: "5px"}}></i>View Courses</button>

              <h6>Give Feedback:</h6>
              <button type="button" class="dashBtnB" data-aos="fade-right" data-aos-duration="1000" data-aos-once="true" data-aos-delay="320" style={{marginBottom: "1rem", width: "150px"}} onclick="window.location.href = '{% url 'user_feedback' %}'"><i class="fas fa-comment-alt" style={{paddingRight: "5px"}}></i>Feedback</button>
            </div>
            <div class="col-md-8 col-lg-8 my-auto">
              <img src='assets/images/dashboard.png' alt="dashboard" style={{maxHeight: "700px"}} />
            </div>
          </div>
        </div>
        </div>
        <Footer />
      </div>
    );
};

export default Dashboard;
